【用途】<br>鉄・ステンレス鋼等の穴あけ。<br><br>【機能・特徴】<br>刃先は特殊な段付形状です。<br>中心と外周の２箇所で切削を行うので穴あけスピードが３倍速い（メーカー比）。<br>バリが出にくく真円に近い穴あけが出来ます。<br>摩擦で生じる熱作用を受けにくい。<br>またドリルにかかる負荷が小さいのでバッテリーの消耗も抑えられます。<br><br>【仕様】<br>●材質/ハイス鋼　六角軸　適応板厚/鉄（ドリル直径Ｘ3倍）、ステンレス鋼（ドリル直径Ｘ1/2倍）　2.0MM 3PCS。<br><br>【商品サイズ】奥行72×幅6×高さ6mm　重量40g<br><br>【注意事項・その他】<br>熱処理された材料（焼き入れ鋼など）には穴あけできません。<br><br><style type="text/css">
